import './App.css';
import './components/Gallery';
import { Gallery } from './components/Gallery';
import { 
  BrowserRouter,
  Routes,
  Route
 } from 'react-router-dom';
function App() {
  return (

      <BrowserRouter>
        <Routes>
            <Route path ="/" element={<Gallery/>}/>
        </Routes>
      </BrowserRouter>

  );
}

export default App;
